import React from 'react'

class App extends React.Component {
	constructor() {
		super();
		this.state = {checked: true};
	}

	render() {
		return <div>
			<input
				type="checkbox"
				defaultChecked={this.state.checked}
			/>
		</div>;
	}
}

export default App;
